/*! Doro.js v1.0.1 | Xypher */
class DoroOptions {
  initContainer;
  speed;
  scream;
  boomChance;
  boomSelector;
  restore;
  screamMax;
  eatChance;
  eatColor;
  eatMax;
  killChance;
  multiplyChance;
  multiplyMax;
  suicideChance;
  suicideMinTimeout;
  suicideMaxTimeout;
}

class Doro {
  doroContainer = null;
  doroImgElem = null;
  initContainer = null;
  gifWidth = 0;
  gifHeight = 0;
  x = 0;
  y = 0;
  angle = Math.random() * 360;
  speed = 10;
  scream = 'DORO!';
  boomChance = 0.05;
  boomSelector = '.boom,input,textarea,select,button,a,hr,label,td,pre,h1,h2,h3,h4,h5,h6,li,svg';
  restore = true;
  boomDuration = 600;
  move = false;
  screamTimeout = null;
  screamMax = 1000;
  eatChance = 1;
  eatColor = 'white';
  eatMax = 2500;
  killChance = 0.5;
  eatTimeout = null;
  multiplyChance = 0.4;
  multiplyMax = 5;
  doroPrime = null;
  suicideChance = 0;
  suicideMinTimeout = 60;
  suicideMaxTimeout = 120;
  suicideTimeout;
  doros;
  doroImg = "data:image/webp;base64,";
  doroRunImg = "data:image/gif;base64,";
  doroDanceImg = "data:image/gif;base64,";
  boomImg = "data:image/gif;base64,";
           
  constructor(options) {
    this.initContainer = options?.initContainer || document.getElementsByTagName('doro-doro')[0];
    if(!this.initContainer) return;
    if(!this.initContainer.tagName !== 'img'){
      const doroDoro = document.createElement('img');
      doroDoro.src = options?.doroImgElem || this.doroImg;
      doroDoro.alt = ":3";
      this.initContainer.appendChild(doroDoro);
    }
    this.speed = options?.speed || this.initContainer.getAttribute('doro-speed') || this.speed;
    this.scream = (options?.scream===undefined && this.initContainer.getAttribute('doro-scream')===null) ? this.scream 
      : options?.scream || this.initContainer.getAttribute('doro-scream');
    this.boomChance = (options?.boomChance===undefined && this.initContainer.getAttribute('doro-boom-chance')===null) ? this.boomChance 
      : options?.boomChance || this.initContainer.getAttribute('doro-boom-chance');
    this.multiplyChance = (options?.multiplyChance===undefined && this.initContainer.getAttribute('doro-multiply-chance')===null) ? this.multiplyChance 
      : options?.multiplyChance || this.initContainer.getAttribute('doro-multiply-chance');
    this.boomSelector = options?.boomSelector || this.initContainer.getAttribute('doro-boom-selector') || this.boomSelector;
    this.restore = (options?.restore===undefined && this.initContainer.getAttribute('doro-restore')===null) ? this.restore 
      : options?.restore || this.initContainer.getAttribute('doro-restore')==='true';
    this.eatChance = (Math.random() < (options?.eatChance || this.initContainer.getAttribute('doro-eat-chance'))) 
      || (this.eatChance && options?.eatChance===undefined && this.initContainer.getAttribute('doro-eat-chance')===null);
    this.eatColor = options?.eatColor || this.initContainer.getAttribute('doro-eat-color') || this.eatColor;
    this.killChance = options?.killChance || this.initContainer.getAttribute('doro-kill-chance') || this.killChance;  
    this.suicideChance = options?.suicideChance || this.initContainer.getAttribute('doro-suicide-chance') || this.suicideChance;
    this.suicideMinTimeout = options?.suicideMinTimeout || this.initContainer.getAttribute('doro-min-timeout') || this.suicideMinTimeout;   
    this.suicideMaxTimeout = options?.suicideMaxTimeout || this.initContainer.getAttribute('doro-max-timeout') || this.suicideMaxTimeout;     
    this.doroPrime = options?.doroPrime;
    this.screamMax = options?.screamMax || this.initContainer.getAttribute('doro-scream-max') || this.screamMax;
    this.eatMax = options?.eatMax || this.initContainer.getAttribute('doro-eat-max') || this.eatMax;
    this.multiplyMax = options?.multiplyMax || this.initContainer.getAttribute('doro-multiply-max') || this.multiplyMax;
    this.multiplyChance = (options?.multiplyChance===undefined && this.initContainer.getAttribute('doro-multiply-chance')===null) ? this.multiplyChance 
      : options?.multiplyChance || this.initContainer.getAttribute('doro-multiply-chance');

    this.doroContainer = document.createElement('div');
    this.doroContainer.classList.add("dorororo");
    this.doroContainer.style.visibility = "hidden";
    this.doroContainer.style.position = "absolute";
    this.doroContainer.style.zIndex = 10000;
    this.doroImgElem = document.createElement('img');
    this.doroImgElem.src = options?.doroImgElem || this.doroRunImg;
    this.doroImgElem.alt = ":3";
    this.doroContainer.appendChild(this.doroImgElem);
    document.body.appendChild(this.doroContainer);

    const initRect = this.initContainer.getBoundingClientRect();
    this.x = initRect.left || 0, //Math.random() * (window.innerWidth - doroContainer.clientWidth),
    this.y = initRect.top || 0, //Math.random() * (window.innerHeight - doroContainer.clientHeight),
    this.gifWidth = this.doroContainer.clientWidth * 1.35,
    this.gifHeight = this.doroContainer.clientHeight * 1.35,
    this.doroContainer.addEventListener('click', () => { this.petDoro(); } , false);
    ['click', 'contextmenu'].forEach(eventName => { this.initContainer.addEventListener(eventName, ()=>{this.petDoro();}, false); });
    const css = `
      .dorover { display:none; }
      .doro-scream { position: absolute; font-family: 'Comic Sans MS', cursive, sans-serif; font-size: 26px; z-index:9010; } 
      .dorostroyed { display:none !important; } 
      .doro-eat { background-color: ${this.eatColor}; border-radius: 50%; width:80px; height:80px; position: absolute; z-index:9000; }
      .doro-explosion { position: absolute; z-index: 9020; transform: scale(8); } `;
    const style = document.createElement('style');
    if (style.styleSheet) style.styleSheet.cssText = css; // For IE
    else style.appendChild(document.createTextNode(css)); // For other browsers
    document.head.appendChild(style);

    //if(!this.doroPrime) this.doroContainer.style.backgroundColor = "red";
  }

  doroDash() {
    if(!this.move) {
      this.stopDoroScreaming();
      this.stopDoroEating();
      return;
    } 
    if(!this.suicideTimeout && Math.random() < this.suicideChance) { 
      this.suicideTimeout = setTimeout(()=>{ this.killDoro(); }, this.suicideMaxTimeout * 1000 ); 
      //this.suicideTimeout = setTimeout(()=>{ this.killDoro(); }, Math.max(this.suicideMaxTimeout * Math.random(), 10 ) * 1000 ); 
    }
    this.initContainer.style.display = 'none';
    this.doroContainer.style.visibility = 'visible';
    this.doroContainer.classList.remove('dorover');
    // Slightly randomize the angle for each movement step
    this.angle += (Math.random() - 0.5) * 0.4; // Adjust randomness
    // Update position based on the angle
    this.x += this.speed * Math.cos(this.angle);
    this.y += this.speed * Math.sin(this.angle);
    // Reflect angle if the GIF hits the boundaries to keep it within the viewport
    if (this.x <= 0 || this.x + this.gifWidth >= window.innerWidth) this.angle = Math.PI - this.angle; // Horizontal reflection       
    if (this.y <= 0 || this.y + this.gifHeight >= window.innerHeight) this.angle = -this.angle; // Vertical reflection      
    // Update the GIF position
    this.doroContainer.style.left = `${this.x}px`;
    this.doroContainer.style.top = `${this.y}px`;
    // Calculate rotation angle for the GIF in degrees
    let rotationAngle = ((this.angle * 180) / Math.PI) % 360;
    this.doroImgElem.style.transform = `rotate(${rotationAngle}deg) ${(Math.abs(rotationAngle) > 90 && Math.abs(rotationAngle) <= 270)? 'scaleY(-1)':''}`;
    // Continue moving the GIF at a set interval
    requestAnimationFrame(this.doroDash.bind(this)); // Use bind to ensure correct 'this' context
    this.explode();
  }

  doroScream() {
    // Create a new element
    const newElement = document.createElement('div');
    newElement.textContent = this.scream || 'DORO!';
    newElement.style.left = `${this.x}px`;
    newElement.style.top = `${this.y}px`;
    newElement.style.transform = this.doroImgElem.style.transform;
    // Check if the GIF is facing left to flip the new element vertically
    const rotationAngle = parseFloat(this.doroImgElem.style.transform.replace(/[^0-9.-]/g, '')) || 0;
    if (Math.abs(rotationAngle) > 90 && Math.abs(rotationAngle) < 270) newElement.style.transform += ' scaleX(-1)'; // Flip vertically
    newElement.classList.add('doro-scream'); 
    newElement.style.color = `rgb(${Math.floor(Math.random() * 256)}, ${Math.floor(Math.random() * 256)}, ${Math.floor(Math.random() * 256)})`
    document.body.appendChild(newElement);

    const scream = document.querySelectorAll(`.doro-scream`);
    for(let i=0; i<scream.length - this.screamMax; i++)
      scream[i].parentNode.removeChild(scream[i]);
  }

  doroEat() { 
    if(!this.eatMax) return;
    // Create a new element
    const newElement = document.createElement('div');
    newElement.style.left = `${this.x}px`;
    newElement.style.top = `${this.y}px`;
    newElement.classList.add('doro-eat'); 
    document.body.appendChild(newElement);

    const eat = document.querySelectorAll(`.doro-eat`);
    for(let i=0; i<eat.length - this.eatMax; i++)
      eat[i].parentNode.removeChild(eat[i]);
  } 

  startDoroScreaming() {
      if(!this.scream || this.screamMax <= 0) return;
      const randomInterval = Math.random() * 2500/this.speed + 50; 
      clearTimeout(this.screamTimeout); // Clear the previous timeout if it exists
      this.screamTimeout = setTimeout(() => {
          this.doroScream();
          this.startDoroScreaming(); // Recursively call to continue the random intervals
      }, randomInterval);
  }

  startDoroEating() {
      if(this.eatMax <= 0) return;
      clearTimeout(this.eatTimeout); // Clear the previous timeout if it exists
      this.eatTimeout = setTimeout(() => {
          this.doroEat();
          this.startDoroEating();
      }, 600/this.speed);
  }

  stopDoroScreaming() {
      clearTimeout(this.screamTimeout);
      this.screamTimeout = null;
  }

  stopDoroEating() {
      clearTimeout(this.eatTimeout);
      this.eatTimeout = null;
  }

  toggleDoroScream() {
      if (!this.move || this.screamTimeout) 
        this.stopDoroScreaming();
      else 
        this.startDoroScreaming();
  }

  toggleDoroEat() {
      if (!this.move || this.eatTimeout) 
        this.stopDoroEating();
      else if(this.eatChance)
        this.startDoroEating();
  }

  petDoro() {
    this.move = !this.move;
    this.toggleDoroScream();
    this.toggleDoroEat();
    if(!this.move) {
      if(Math.random() < this.killChance){
        this.killDoro();
      }
      else{
        this.doroImgElem.style.transform = this.doroImgElem.style.transform.replace(/rotate\(.*?\)/, '');
        this.doroImgElem.style.transform = this.doroImgElem.style.transform.replace(/scale[X|Y]\(.*?\)/, '');
        this.doroImgElem.src = this.doroDanceImg;
      }
    }
    else {
      this.doroImgElem.src = this.doroRunImg;
      this.multiply();
    }
    this.doroDash();
  }

  killDoro(){
    this.move = false;
    this.stopDoroScreaming();
    this.stopDoroEating();
    this.doroImgElem.style.transform = this.doroImgElem.style.transform.replace(/rotate\(.*?\)/, '');
    this.doroImgElem.style.transform = this.doroImgElem.style.transform.replace(/scale[X|Y]\(.*?\)/, '');
    this.doroImgElem.src = this.boomImg;
    this.doroImgElem.style.transform += ' scaleX(3) scaleY(3)';
    setTimeout(()=>{
      this.doroContainer.classList.add("dorover");
      if(this.restore && !document.querySelectorAll('.dorororo:not(.dorover)').length) this.reset();      
    }, this.boomDuration);
  }

  multiply() {
    if(!this.doros) {
      this.doros = [];
      return;
    }
    if(Math.random() > this.multiplyChance) return;
    const maxDoros = Math.floor(this.multiplyMax * Math.random()) + 1;
    for(let i = 1; i<=maxDoros; i++){      
      const childOfDoro = new Doro({ 
          initContainer: document.createElement('img'),
          speed: this.speed,
          scream: this.scream,
          boomChance: this.boomChance,
          restore: this.restore,
          boomDuration: this.boomDuration,
          eatChance: this.eatChance,
          eatColor: this.eatColor,
          killChance: this.killChance,
          doroPrime: this.doroPrime??this,
          suicideChance: 1,
          suicideMaxTimeout: Math.max(this.suicideMaxTimeout * Math.random(), 10 ),
          eatMax: this.eatMax,
          screamMax: this.screamMax
        });
      childOfDoro.x = this.x;
      childOfDoro.y = this.y;
      document.body.appendChild(childOfDoro.initContainer);
      childOfDoro.petDoro();
      this.doros.push(childOfDoro);
    }
  }

  explode() {
      if(Math.random()>this.boomChance) return;
      const doroRect = this.doroContainer.getBoundingClientRect();
      document.querySelectorAll(this.boomSelector).forEach(element => {
          if (element !== this.doroContainer && !element.classList.contains('dorostroyed')) {
              const rect = element.getBoundingClientRect();
              // Check if doroContainer overlaps with the element
              const isOverlapping = !(
                  doroRect.right < rect.left ||
                  doroRect.left > rect.right ||
                  doroRect.bottom < rect.top ||
                  doroRect.top > rect.bottom
              );
              // If overlapping, hide the element and display a GIF at its center
              if (isOverlapping) {
                  // Hide the element
                  element.classList.add('dorostroyed');
                  // Create a new GIF element
                  const explosion = document.createElement('img');
                  explosion.src = this.boomImg;
                  explosion.classList.add("doro-explosion");
                  // Calculate the center position
                  const centerX = doroRect.left + 50;
                  const centerY = doroRect.top + 50;
                  // Position the GIF at the center
                  explosion.style.left = `${centerX}px`;
                  explosion.style.top = `${centerY}px`;
                  //explosion.style.transform += ` scale(${Math.random()*10+0.5})`;
                  // Append the GIF to the body
                  document.body.appendChild(explosion);
                  setTimeout(() => {
                    explosion.remove();
                  }, this.boomDuration);
              }
          }
      });
  }

  reset() {
    this.move = false;
    this.stopDoroScreaming();
    this.stopDoroEating();
    this.doros?.forEach(d=>{
      d.killDoro();
    });
    this.doros = [];
    document.querySelectorAll(`.dorostroyed`).forEach(e => { e.classList.remove(`dorostroyed`); });
    document.querySelectorAll(`.doro-scream,.doro-eat`).forEach(e => { e.remove(); });
    this.initContainer.style.display = 'inline';
    this.doroImgElem.src = this.doroRunImg;
    const initRect = this.initContainer.getBoundingClientRect();
    this.x = initRect.left || 0;
    this.y = initRect.top || 0;
    if(this.initContainer.tagName === 'img') this.initContainer.src = this.doroDanceImg;
    else this.initContainer.firstChild.src = this.doroDanceImg;
    this.doroPrime?.reset();
  }

}

document.querySelectorAll('doro-doro').forEach(e=>{new Doro({initContainer:e})})
